In bors.toml, you can set pre-test , pre-try , and pre-merge hooks to be a list of URLs: pre-test-hooks = ["https://example.com/pre-test-example"]
pre-try-hooks = ["https://example.com/pre-try-example"]
pre-merge-hooks = [ "https://example.com/pre-merge-example1", "https://example.com/pre-merge-example2",
] The pre-test and pre-try hooks are invoked after bors-ng has prepared a commit for testing, but before running tests. They may be used to alter the code being tested – for example, by running an auto-formatter. The pre-merge hook is invoked after an approved commit has passed testing, just before bors-ng merges it into the target branch. It cannot alter the code, but it can do other things, like trigger a deployment process or create a tag. A hook is "invoked" by POSTing a JSON document to the given URL – something like: { "phase": "pre-test", "repository": "https://github.com/bors-ng/bors-ng", "work-branch": "staging.tmp", "target-branch": "master", "commit-id": "0b7d6e1ccf9d5fdbce73b690da8a4f76fffc38eb", "timeout": 60, "callback": "https://bors.tech/webhook/callback/5a4857627"
} More keys may be added in the future. Unrecognized keys should be ignored. When implementing a hook, the first thing you should do is validate the payload. Normally this includes the following steps: Confirm that the request actually came from the bors-ng service, by checking the X-Bors-NG-Signature header. This will contain a comma-separated list of signatures, like: X-Bors-NG-Signature: sha256-hmac=5257a869e7ecebeda32affa62cdca3fa51cad7e77a0e56ff536d0ce8e108d8bd, some-future-algorithm=6ffbb59b2300aae63f272406069a9788598b792a944a07aba816edb039989a39 Right now the only supported form is sha256-hmac, which will contain hex-encoded SHA256-HMAC of the request body. The key is a unique per-repo secret, which can be obtained from your bors-ng dashboard. In the future, more algorithms may be added, and you should be prepared to detect and ignore unrecognized signatures. Remember to use a constant-time equality test whenever checking HMAC signatures. For example, in Python use hmac.compare_digest . Before manipulating the work-branch, confirm that its HEAD matches the given commit-id. This helps avoid race conditions in case the bors-ng service and your hook get confused and out-of-sync. Depending on what your hook does, it may also make sense to revalidate this commit id later. For example, if you're going to mutate the branch, don't use git push --force; always use git push or git push --force-with-lease . The hook responds by POSTing JSON documents to the given callback URL. These documents look like: { "status": "success", "comment": "Hook complete - for details see [here](https://...)"
} The "status" field must be one of "success", "failure", or "pending". The "comment" field contains arbitrary Github-flavored Markdown. The "timeout" field in the request body indicates how many seconds bors-ng is willing to wait for the callback to be invoked. If bors-ng receives a "pending" response, then it resets its timeout. We recommend that if a hook needs more than this amount of time to run, then it should send a "pending" callback every (timeout/2) seconds to extend the timeout.
